function packEntities(entities) {
    const buffer = new ArrayBuffer(entities.length * 1); // 1 byte per entity
    const uint8Array = new Uint8Array(buffer);
    for (let i = 0; i < entities.length; i++) {
        const entity = entities[i];
        const byte = (entity.id << 3) | entity.size;
        uint8Array[i] = byte;
    }
    return buffer;
}

function unpackEntities(buffer) {
    const uint8Array = new Uint8Array(buffer);
    const entities = [];
    for (let i = 0; i < uint8Array.length; i++) {
        const byte = uint8Array[i];
        const entity = {
            id: byte >> 3,
            size: byte & 0x07
        };
        entities.push(entity);
    }
    return entities;
}
```

