        static async Task<VACBanInfo> GetVACBanInfo(string steam64Id)
        {
            using (var client = new HttpClient())
            {
                var response = await client.GetAsync($"https://api.steampowered.com/ISteamUser/GetPlayerBans/v1/?key=YOUR_STEAM_API_KEY&steamids={steam64Id}");

                if (response.IsSuccessStatusCode)
                {
                    var responseBody = await response.Content.ReadAsStringAsync();
                    var data = JsonConvert.DeserializeObject<PlayerBansResponse>(responseBody);
                    var playerBanInfo = data.players[0];

                    return new VACBanInfo
                    {
                        VACBans = playerBanInfo.NumberOfVACBans,
                        LastVACBanDate = playerBanInfo.DaysSinceLastBan == 0 ? "No VAC ban" : DateTime.Now.AddDays(-playerBanInfo.DaysSinceLastBan).ToString("yyyy-MM-dd")
                    };
                }
                else
                {
                    throw new Exception("Failed to retrieve VAC ban info");
                }
            }
        }
